                name: 'Kalyani',
                count: 0
            }
    
    
        }
        IncrementCount=() =>{
            this.setState(prevstate =>{return{count:prevstate.count +1}})
        }
         render(){
             return <div>This is the UpdatedComponent
                 <OrginalComponent count = {this.state.count} IncrementCount = {this.IncrementCount}>

                 </OrginalComponent>
             </div>
         }
    }
    return NewComponent;
}
